import React from "react";
import './Gallery.css'
  
class Gallery extends React.Component {
  constructor(props) {
    super(props);
    this.state = { text: "Welcome to gallery!" };
  }
  
  componentWillMount() {
    this.setState({
      text: "GeeksforGeeks",
    });
  }
  
  render() {
    return <h1>{this.state.text}</h1>;
  }
}
  
export default Gallery;
